  {nameDir: 'папка1.1.1', id: 5,childe: []},
  {nameDir: 'папка1.1',   id: 2,childe: [6]},
  {nameDir: 'папка2.1',   id: 4,childe: []},
  {nameDir: 'папка2.2',   id: 3,childe: []}
];

const App = () =>{

let newList =  name.map( name  => <li>{name}</li>);
let neList =  listDir.map( name  => <li>{name.nameDir}</li>);
  return (
    <div className="App">
      <ul><p>список</p>
      <li  key={listDir.id}>{neList}</li>
      </ul>
    </div>
  );
  console.log (newList);
}


export default App;
